// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

// @title 智能合約範例
contract Example {
    /// @dev 尚未檢查過
    bool hasChecked = false;

    int256 xInt256 = -100;
    // int256's alias
    int xInt = -100;

    // @dev uint無符號的整數型態
    uint8 xUint8 = 128;

    string private str = "dynamic";

    function booleanExample() 
        public 
    {

        

        /// @notice 符號「!」代表相反： xxx的相反
        /// @dev 如果還沒被檢查過...
        if (!hasChecked) {
            // ...
        }

        /// @noticc  符號「!=」代表不等於： xxx不等於xxx
        if (hasChecked != true) {
            // ...
        }

        /// @notice 符號「==」代表： xxx等於xxx
        /// @dev 如果已經被檢查過
        if (hasChecked == true) {
            // ...
        }

        /// @notice 「&&」代表著「...且... 」
        /// @dev 如果已經被檢查過「且」已支付
        bool hasPaid = true;
        if (hasChecked && hasPaid) {
            //....
        }

        /// @notice 「||」代表著「...或... 」
        /// @dev 如果未被檢查過「或」未支付
        if (!hasChecked || !hasPaid) {
            //....
        }
    }

}

